import React from 'react';
import './collection-page.styles.css';
import {
  Layout, Input, Row, Col,
} from 'antd';
import CardItem from '../../components/card-item/card-item.component';

const { Content } = Layout;
const { Search } = Input;

const CollectionPage = () => (
  <Layout style={{ padding: '0 24px 24px' }}>
    <Search
      placeholder="Search Category"
      enterButton
      size="large"
      style={{ marginBottom: '20px' }}
    />
    <h2>Product  Pages</h2>
    <Content
      className="site-layout-background"
      style={{
        padding: 24,
        margin: 0,
        minHeight: 600,
      }}
    >
      <Row gutter={[48, 40]}
      >
        <Col xs={24} sm={12} md={6} lg ={4} className="gutter-row" span={6}>
          <CardItem />
        </Col>
        <Col xs={24} sm={12} md={6} lg ={4} className="gutter-row" span={6}>
          <CardItem />
        </Col>
        <Col xs={24} sm={12} md={6} lg ={4} className="gutter-row" span={6}>
          <CardItem />
        </Col>
        <Col xs={24} sm={12} md={6} lg ={4} className="gutter-row" span={6}>
          <CardItem />
        </Col>
        <Col xs={24} sm={12} md={6} lg ={4} className="gutter-row" span={6}>
          <CardItem />
        </Col>
        <Col xs={24} sm={12} md={6} lg ={4} className="gutter-row" span={6}>
          <CardItem />
        </Col>
        <Col xs={24} sm={12} md={6} lg ={4} className="gutter-row" span={6}>
          <CardItem />
        </Col>

      </Row>
    </Content>
  </Layout>

);

export default CollectionPage;
